gqF(){return"Datenschutzerkl\xe4rung \u2013 ASConnect-Anwendung\n\n1) Identit\xe4t des Verantwortlichen\nDie in der ASConnect-Anwendung erhobenen Daten werden von AngelmanAnalytics als Verantwortlichem f\xfcr die Verarbeitung verarbeitet.\nBei Fragen zu Ihren Daten oder zur Aus\xfcbung Ihrer Rechte k\xf6nnen Sie uns unter folgender Adresse kontaktieren: contact@angelmananalytics.org.\n____________________________________________\n2) Zwecke der Verarbeitung\nDie \xfcber die Anwendung durchgef\xfchrten Datenverarbeitungen verfolgen folgende Zwecke:\n\u2022 Erstellung und Verwaltung Ihres Benutzerkontos f\xfcr einen namentlichen Zugang zur ASConnect-Anwendung;\n\u2022 Nutzung von Geolokalisierungsfunktionen zur Anzeige von:\n  o Profilen betroffener Personen nach verschiedenen Kriterien (geografische Entfernung, Genotyp, Altersgruppe);\n  o Verbesserung des Dienstes und Personalisierung der Benutzererfahrung.\n\u2022 Gewinnung von Daten, die keine Identifizierung von Personen erm\xf6glichen, zu statistischen Zwecken: Anzahl der vom Angelman-Syndrom betroffenen Personen, Altersverteilung...\n____________________________________________\n3) Kategorien der erhobenen Daten\nEs k\xf6nnen folgende Daten erhoben werden:\n\u2022 Identifikationsdaten:\n  o Geschlecht, Vorname, Nachname, E-Mail-Adresse, Passwort, Foto,\n  o geheime Frage und Antwort (im Falle eines vergessenen Passworts);\n\u2022 Sensible Daten:\n  o Genotyp, Standort.\nDie Rechtsgrundlage f\xfcr diese Verarbeitungen ist die ausdr\xfcckliche und informierte Einwilligung des Nutzers.\n____________________________________________\n4) Dauer der Datenspeicherung\nDie Daten werden f\xfcr die gesamte Dauer der Nutzung des Kontos gespeichert und anschlie\xdfend sp\xe4testens 12 Monate nach der letzten Aktivit\xe4t gel\xf6scht.\nDer Nutzer kann sein Recht auf L\xf6schung jederzeit direkt in der Anwendung \xfcber das Men\xfc aus\xfcben:\nDatenschutzerkl\xe4rung \u2192 Recht auf L\xf6schung.\n____________________________________________\n5) Empf\xe4nger und Hosting der Daten\nDie Daten werden sicher auf den Servern von PythonAnywhere gehostet.\nDie Daten werden innerhalb der Europ\xe4ischen Union gespeichert.\n(Weitere Informationen zur Datenschutzrichtlinie des Anbieters finden Sie unter https://www.pythonanywhere.com/privacy/.)\nDie Webanwendung wird von O2Switch in Frankreich gehostet, siehe https://www.o2switch.fr/du-rgpd.pdf.\n____________________________________________\n6) Rechte der Nutzer\nGem\xe4\xdf der Verordnung (EU) 2016/679 (DSGVO) verf\xfcgen Nutzer \xfcber folgende Rechte:\n\u2022 Recht auf Auskunft, Berichtigung und L\xf6schung (\u201eRecht auf Vergessenwerden\u201c) \u2014 direkt \xfcber ihr Profil oder das Men\xfc Datenschutzerkl\xe4rung \u2192 Recht auf L\xf6schung;\n\u2022 Recht auf Widerspruch, Daten\xfcbertragbarkeit und Einschr\xe4nkung der Verarbeitung;\n\u2022 Recht auf Widerruf der Einwilligung jederzeit.\nZur Aus\xfcbung dieser Rechte (au\xdfer dem Recht auf L\xf6schung innerhalb der Anwendung) k\xf6nnen Sie eine E-Mail an contact@angelmananalytics.org senden.\n____________________________________________\n7) Sicherheit und Vertraulichkeit\nAlle Daten werden w\xe4hrend der Speicherung und \xdcbertragung verschl\xfcsselt.\nPassw\xf6rter werden gem\xe4\xdf bew\xe4hrten Sicherheitspraktiken gehasht und s\xe4mtliche Kommunikation mit dem Dienst erfolgt \xfcber das HTTPS-Protokoll.\n____________________________________________\n8) Ausdr\xfcckliche Einwilligung\nDie Registrierung in der ASConnect-Anwendung erfordert die ausdr\xfcckliche und informierte Einwilligung des Nutzers f\xfcr die in Abschnitt 2 beschriebenen Verarbeitungen.\nDer Nutzer kann diese Einwilligung jederzeit \xfcber die Kontoeinstellungen oder durch direkte Kontaktaufnahme unter contact@angelmananalytics.org widerrufen."},
