gqF(){return"Pol\xedtica de privacidade \u2013 Aplica\xe7\xe3o ASConnect\n\n1) Identidade do respons\xe1vel pelo tratamento\nOs dados recolhidos na aplica\xe7\xe3o ASConnect s\xe3o tratados pela AngelmanAnalytics na qualidade de respons\xe1vel pelo tratamento.\nPara qualquer quest\xe3o relativa aos seus dados ou ao exerc\xedcio dos seus direitos, pode contactar-nos em: contact@angelmananalytics.org.\n____________________________________________\n2) Finalidades do tratamento\nOs tratamentos de dados realizados atrav\xe9s da aplica\xe7\xe3o t\xeam as seguintes finalidades:\n\u2022 Cria\xe7\xe3o e gest\xe3o da sua conta de utilizador para um acesso nominativo \xe0 aplica\xe7\xe3o ASConnect;\n\u2022 Utiliza\xe7\xe3o das funcionalidades de geolocaliza\xe7\xe3o para visualizar:\n  o Perfis de pessoas abrangidas segundo diferentes crit\xe9rios (dist\xe2ncia geogr\xe1fica, gen\xf3tipo, faixa et\xe1ria);\n  o Melhoria do servi\xe7o e personaliza\xe7\xe3o da experi\xeancia do utilizador.\n\u2022 Extra\xe7\xe3o de dados que n\xe3o permitem identificar pessoas para fins estat\xedsticos: n\xfamero de pessoas afetadas pela s\xedndrome de Angelman, distribui\xe7\xe3o et\xe1ria...\n____________________________________________\n3) Categorias de dados recolhidos\nPodem ser recolhidos os seguintes dados:\n\u2022 Dados de identifica\xe7\xe3o:\n  o sexo, nome, apelido, endere\xe7o de correio eletr\xf3nico, palavra-passe, fotografia,\n  o pergunta e resposta secreta (em caso de esquecimento da palavra-passe);\n\u2022 Dados sens\xedveis:\n  o gen\xf3tipo, localiza\xe7\xe3o.\nA base legal destes tratamentos \xe9 o consentimento expl\xedcito e informado do utilizador.\n____________________________________________\n4) Per\xedodo de conserva\xe7\xe3o dos dados\nOs dados s\xe3o conservados durante toda a dura\xe7\xe3o da utiliza\xe7\xe3o da conta e posteriormente eliminados no prazo m\xe1ximo de 12 meses ap\xf3s a \xfaltima atividade.\nO utilizador pode exercer a qualquer momento o seu direito ao apagamento diretamente na aplica\xe7\xe3o, atrav\xe9s do menu:\nPol\xedtica de privacidade \u2192 Direito ao apagamento.\n____________________________________________\n5) Destinat\xe1rios e alojamento dos dados\nOs dados s\xe3o alojados de forma segura nos servidores da PythonAnywhere.\nOs dados s\xe3o armazenados na Uni\xe3o Europeia.\n(Para mais informa\xe7\xf5es sobre a pol\xedtica de prote\xe7\xe3o de dados do fornecedor, consulte https://www.pythonanywhere.com/privacy/.)\nA aplica\xe7\xe3o web \xe9 alojada pela O2Switch em Fran\xe7a, consulte https://www.o2switch.fr/du-rgpd.pdf.\n____________________________________________\n6) Direitos dos utilizadores\nEm conformidade com o Regulamento (UE) 2016/679 (RGPD), os utilizadores disp\xf5em dos seguintes direitos:\n\u2022 Direito de acesso, retifica\xe7\xe3o e apagamento (\xabdireito ao esquecimento\xbb) \u2014 diretamente atrav\xe9s do perfil ou do menu Pol\xedtica de privacidade \u2192 Direito ao apagamento;\n\u2022 Direito de oposi\xe7\xe3o, portabilidade e limita\xe7\xe3o do tratamento;\n\u2022 Direito de retirar o consentimento a qualquer momento.\nPara exercer estes direitos (exceto o direito ao apagamento acess\xedvel na aplica\xe7\xe3o), pode enviar um email para contact@angelmananalytics.org.\n____________________________________________\n7) Seguran\xe7a e confidencialidade\nTodos os dados s\xe3o cifrados durante o armazenamento e a transmiss\xe3o.\nAs palavras-passe s\xe3o tratadas de acordo com as boas pr\xe1ticas de seguran\xe7a e todas as comunica\xe7\xf5es com o servi\xe7o s\xe3o efetuadas atrav\xe9s do protocolo HTTPS.\n____________________________________________\n8) Consentimento expl\xedcito\nA inscri\xe7\xe3o na aplica\xe7\xe3o ASConnect requer o consentimento expl\xedcito e informado do utilizador para os tratamentos descritos na sec\xe7\xe3o 2.\nO utilizador pode retirar este consentimento a qualquer momento atrav\xe9s das defini\xe7\xf5es da conta ou por contacto direto para contact@angelmananalytics.org."},
